import React from 'react';
import LineGraph  from './components/LineGraph';
import RoomInputGrid from './components/RoomInputGrid';
import MaterialGrid from './components/MaterialsGrid';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import RoomSolver from './utilities/RoomSolver';

const App = () => {
    const plotData = [[1, 1], [100, 2], [500, 4.87], [2500, 2], [4000, 7]];
    return (
        <>
            <Grid container spacing={3} justify="center">
                <Grid item xs={10}>
                    <MaterialGrid />
                </Grid>
                <Grid item xs={10}>
                    <RoomInputGrid />
                </Grid>
                <Grid item xs={12} align="center">
                    <TextField
                        id="standard-basic"
                        label="Volume (m^3)"
                    />
                </Grid>
                <Grid item xs={12} align="center">
                    <Button variant="outlined" color="primary">
                        Display Room
                    </Button>
                </Grid>
                <Grid item xs={12} align="center">
                    <LineGraph data={plotData}/>
                </Grid>
            </Grid>
        </>
    );
};


export default App;
